import{e as p}from"./app.630af5f2.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const a={},r=p('<h1 id="l" tabindex="-1"><a class="header-anchor" href="#l" aria-hidden="true">#</a> L\u2026</h1><p>\u8FD9\u591C\u3002\u59EC\u5A1C\u542C\u89C1\u67D0\u79CD\u58F0\u3002</p><p>\u6F06\u9ED1\u7684\u5149\u666F\uFF0C\u6708\u8272\u8BE1\u5F02\u3002\u82B1\u56ED\u4E2D\uFF0C\u86C7\u5728\u591C\u884C\u3002</p><p>\u6B21\u65E5\u3002</p><p>\u686B\u6469\u8F6C\u9192\u65F6\uFF0C\u59BB\u8BF4\u59D0\u59D0\u5DF2\u56DE\u53BB\u5929\u7A7A\u3002</p><p>\u5965\u6258\u5927\u5E1D\u884C\u8DEF\u7684\u6B65\u6001\u504F\u9642\uFF1A\u300C\u897F\u65B9\u7684\u5996\u5B7D\u53C8\u6765\u9020\u6B21\uFF0C\u8FE6\u697C\u82CD\u5170\u5E26\u4E86\u5341\u4E8C\u6B63\u5C06\u706B\u901F\u5954\u8D74\u524D\u7EBF\u3002\u300D</p><p>\u300C\u90A3\u2026\u2026\u62DC\u4E9A\u65AF\u65B9\u9762\u5462\uFF1F\u662F\u5426\u4E5F\u51C6\u5907\u6D3E\u5175\uFF1F\u300D</p><p>\u300C\u54C8\u54C8\uFF0C\u600E\u4E48\uFF1F\u5B69\u5B50\uFF0C\u4F60\u60F3\u4EB2\u7387\u6211\u519B\u524D\u5F80\u8FCE\u654C\uFF1F\u300D</p><p>\u300C\u7687\u671D\u8FD8\u662F\u5929\u7A7A\uFF0C\u90FD\u662F\u686B\u6469\u7684\u5BB6\u56FD\u3002\u6D88\u706D\u5996\u9B54\uFF0C\u66F4\u662F\u4E49\u4E0D\u5BB9\u8F9E\u7684\u89C9\u609F\u3002\u300D</p><p>\u300C\u8BF4\u5F97\u597D\uFF01\u300D\u5965\u6258\u5927\u5E1D\u9732\u51FA\u6EE1\u610F\u7684\u7B11\u5BB9\uFF1A\u300C\u686B\u6469\uFF0C\u4F60\u521A\u4E0E\u5C0F\u5973\u5B8C\u5A5A\uFF0C\u6B63\u5728\u6D53\u60C5\u871C\u610F\u4E4B\u95F4\uFF0C\u6211\u4E0E\u4F60\u59D0\u59D0\u90FD\u4E0D\u4F1A\u8BA9\u4F60\u5E26\u5175\u4F5C\u6218\u3002\u5DF2\u9063\u6770\u5F17\u900A\u5B50\u7235\u5E26\u5175\u51FA\u51FB\uFF0C\u914D\u5408\u5929\u7A7A\uFF0C\u4F5C\u6210\u5939\u51FB\u4E4B\u52BF\u3002\u686B\u6469\uFF0C\u4F60\u4FBF\u5B89\u5FC3\u966A\u4F34\u5C0F\u5973\u5427\u3002\u300D</p><p>\u300C\u965B\u4E0B\u7684\u811A\u4F24\u4E86\u5417\uFF1F\u300D</p><p>\u300C\u5514\u3002\u4F60\u662F\u8D1D\u73B2\u8FBE\u7684\u592B\u541B\uFF0C\u8BE5\u53EB\u6211\u4EC0\u4E48\uFF1F\u300D</p><p>\u686B\u6469\u6709\u4E9B\u5C34\u5C2C\uFF0C\u5374\u8FD8\u662F\u53EB\u4E86\uFF1A\u300C\u7236\u7687\u965B\u4E0B\u2026\u2026\u300D</p><p>\u2026\u2026</p><p>\u5728\u4E4B\u540E\u7684\u65E5\u5B50\uFF0C\u4FBF\u662F\u82CD\u5170\u7684\u6218\u573A\u6216\u8005\u686B\u6469\u7684\u871C\u6708\u3002</p><p>\u59EC\u5A1C\u4F9D\u7136\u6BCF\u591C\u542C\u89C1\u86C7\u884C\u3002\u67D0\u6B21\u9F13\u8DB3\u52C7\u6C14\u8FFD\u51FA\uFF0C\u7ADF\u649E\u7834\u7236\u7687\u548C\u59D0\u59D0\u7684\u5978\u60C5\u3002</p><p>\u300C\u4F60\u2026\u2026\u300D</p><p>\u5965\u6258\u628A\u51E0\u8FD1\u865A\u8131\u7684\u8D1D\u73B2\u8FBE\u629B\u843D\u4E00\u8FB9\uFF0C\u5979\u8D64\u88F8\u7684\u8EAB\u8EAF\u8DCC\u8FDB\u82B1\u8349\uFF0C\u6298\u4E86\u9752\u82D7\u3002</p><p>\u300C\u7236\u2026\u2026\u7236\u7687\u2026\u2026\u554A\u2014\u2014\u300D</p><p>\u5965\u6258\u50CF\u731B\u517D\u4E00\u6837\u6251\u5012\u5E7C\u5C0F\u7684\u5973\u7AE5\uFF0C\u4E0D\u7531\u5979\u6323\u624E\u3002\u59EC\u5A1C\u89C6\u7834\u4E86\u8D25\u5FB7\u7684\u5978\u60C5\uFF0C\u4ED6\u60DF\u6709\u7EE7\u7EED\u8D25\u574F\u5979\u3002</p><p>\u5E7C\u5973\u662F\u5B34\u5F31\u7684\uFF0C\u81F3\u51C0\u7684\u3002\u59EC\u5A1C\u4E0D\u66FE\u653E\u5F03\u6323\u624E\uFF0C\u5965\u6258\u773C\u5185\u6298\u5C04\u51FA\u5982\u6B64\u51F6\u72C2\u7684\u5149\u3002\u4E27\u5FC3\u75C5\u72C2\u3002</p><p>\u722A\u7259\u6495\u788E\u5979\u8863\u88F3\uFF0C\u5206\u5F00\u5927\u817F\uFF0C\u5C31\u50CF\u6076\u72FC\u6446\u5F04\u7740\u7F8A\u7F94\u3002</p><p>\u300C\u59EC\u5A1C\uFF0C\u6211\u7684\u5B69\u3002\u4F60\u4E0D\u53EF\u4EE5\u53EB\u558A\uFF0C\u8981\u5C55\u5F00\u8EAB\u4F53\u4F9B\u6211\u65BD\u6DEB\u3002\u4F60\u82E5\u6297\u62D2\uFF0C\u5FC5\u89C1\u4E0D\u5230\u660E\u65E5\u7684\u592A\u9633\uFF01\u300D</p><p>\u5468\u8EAB\u6E05\u6F88\uFF0C\u7EDD\u65E0\u4E00\u4E1D\u4F53\u6BDB\u3002\u59EC\u5A1C\u5659\u7740\u773C\u6CEA\uFF0C\u98A4\u6296\u7740\u4E0D\u6562\u54ED\u558A\u3002\u8FD9\u65E0\u90AA\u7684\u5E7C\u5973\u4FBF\u5C48\u670D\u7236\u4EB2\u7684\u6DEB\u5A01\u3002</p><p>\u300C\u6C42\u4F60\u2026\u2026\u7236\u7687\u3002\u4F60\u653E\u8FC7\u59EC\u5A1C\uFF0C\u653E\u8FC7\u5979\u3002\u300D\u8D1D\u73B2\u8FBE\u6073\u6C42\u7740\uFF0C\u8EAB\u4E0A\u8FD8\u7C98\u7740\u7CBE\u6DB2\u7684\u6591\u3002\u8FD9\u5BF9\u5973\u5B69\u6765\u81EA\u4ED6\u7684\u7CBE\u6DB2\uFF0C\u4E5F\u5F53\u5F52\u4E8E\u3002</p><p>\u59EC\u5A1C\u4E0D\u8981\u52A8\u3002\u5979\u4E00\u52A8\uFF0C\u4ED6\u5C31\u504F\u5931\u9634\u9053\u7684\u53E3\u5F84\u3002\u4ED6\u538B\u5728\u5979\u5E7C\u5C0F\u7684\u8EAB\u4F53\uFF0C\u5728\u5979\u5C1A\u672A\u957F\u6210\u7684\u65F6\u5019\uFF0C\u8D25\u574F\u5979\u3002\u4E0D\u53BB\u601D\u91CF\uFF0C\u4E0D\u7559\u4F59\u5730\u3002</p><p>\u300C\u7236\u2026\u2026\u7236\u7687\uFF0C\u59EC\u5A1C\u4EE5\u540E\uFF0C\u4E0D\u4F1A\u518D\u8C03\u76AE\u4E86\u3002\u7236\u7687\u2026\u2026\u300D</p><p>\u8FD9\u7AE5\u7A1A\u7684\u53E5\u5B50\uFF0C\u66F4\u52A0\u52A9\u957F\u9B3C\u755C\u7684\u6B32\u671B\u3002\u65E0\u7AEF\u7AEF\u6DF1\u591C\u4E0D\u7720\u7684\u5C0F\u5B69\uFF0C\u5F53\u4EE5\u4E3A\u6212\u3002</p><p>\u4E73\u623F\u5E76\u6CA1\u6709\u53D1\u80B2\uFF0C\u5374\u4E00\u6837\u62E5\u6709\u539F\u59CB\u672C\u80FD\u3002\u7C89\u5AE9\u7CBE\u7EC6\u7684\u4E0B\u4F53\uFF0C\u578B\u72B9\u672A\u6210\u3002\u4ED6\u523A\u63A2\u7740\uFF0C\u624B\u6307\u548C\u9634\u830E\u3002</p><p>\u59EC\u5A1C\u5E76\u4E0D\u77E5\u8FD9\u884C\u4E3A\uFF0C\u53D1\u81EA\u672C\u80FD\u754F\u60E7\u3002\u4ED6\u538B\u5728\u5979\u7684\u8EAB\u4E0A\uFF0C\u96BE\u4EE5\u547C\u5438\u3002</p><p>\u4ED6\u64AC\u5F00\u95E8\u6237\uFF0C\u8FD9\u5267\u75DB\u706B\u8FA3\u8FA3\u7684\u94BB\u5FC3\u3002\u662F\u70EB\u7684\u3002\u8089\u4F53\u6491\u88C2\uFF0C\u6495\u5F00\uFF0C\u9B3C\u755C\u66B4\u884C\u3002</p><p>\u6709\u8840\u6DB2\u6EA2\u51FA\u6765\uFF0C\u60E8\u4E0D\u5FCD\u7779\u3002</p><p>\u59EC\u5A1C\u7684\u60E8\u53EB\u58F0\u90A3\u7528\u8A00\u8BED\u5F62\u5BB9\uFF0C\u51C4\u5389\u5730\u526A\u7834\u591C\u5BAB\u3002\u5965\u6258\u5F3A\u6342\u4E86\u5979\u7684\u5634\uFF0C\u624B\u6307\u6390\u70C2\u5979\u7684\u820C\u5374\u4F9D\u7136\u6B62\u4E0D\u4F4F\u5979\u7684\u54ED\u53EB\u3002</p><p>\u8D1D\u73B2\u8FBE\u8EBA\u843D\u5728\u8349\u4E1B\uFF0C\u5979\u65E0\u529B\u7AD9\u8D77\u8EAB\u6765\u3002\u4FA7\u8FC7\u8138\u4E0D\u613F\u76EE\u7779\uFF0C\u4E00\u6761\u9752\u86C7\u5728\u5979\u811A\u8FB9\u722C\u884C\u3002</p><p>\u5973\u513F\u7684\u8840\u6CEA\u662F\u59D1\u606F\uFF0C\u8FD9\u60B2\u5267\u7684\u4E2A\u6027\u53EA\u5728\u5348\u591C\u6DF1\u5BAB\u8868\u6F14\u3002</p><p>\u7532\u866B\u722C\u4E0A\u8D1D\u73B2\u8FBE\u7684\u4E73\u623F\uFF0C\u89E6\u987B\u8BD5\u63A2\u7740\u6D51\u6D4A\u7684\u7CBE\u6591\u3002\u5979\u7684\u76AE\u80A4\u56E0\u6B64\u53D8\u5F97\u654F\u611F\uFF0C\u773C\u4E0D\u6562\u671B\u3002</p><p>\u59EC\u5A1C\u7684\u8EAB\u4F53\u662F\u597D\u7684\u3002\u90A3\u6837\u72ED\u5C0F\u7684\u9634\u9053\u4F9D\u7136\u85CF\u7740\u4E30\u76DB\u7684\u5FEB\u611F\u3002</p><p>\u8FD9\u5FEB\u611F\u5728\u5979\u7684\u707E\u96BE\uFF0C\u53EA\u6709\u5965\u6258\u8840\u8109\u94FA\u5F20\u3002\u624B\u81C2\u4E0A\u7684\u6293\u75D5\u73B0\u51FA\u6E10\u6D53\u8840\u8272\u3002</p><p>\u5979\u6574\u4E2A\u90FD\u8981\u88C2\u5F00\uFF0C\u6B7B\u4EA1\u7EC8\u4E8E\u6E10\u8FD1\u3002</p><p>\u7236\u7231\u6C79\u6D8C\u7684\u65F6\u5019\uFF0C\u5373\u4FBF\u7AE5\u5C38\u4EA6\u505A\u6210\u7761\u7F8E\u4EBA\u7684\u6E29\u9999\u3002</p><p>\u8D8A\u591A\u9C9C\u8840\uFF0C\u8D8A\u662F\u7EDD\u8272\u3002</p><p>\u2026\u2026</p><p>\u300C\u8D1D\u73B2\u8FBE\u3002\u4F60\u5F53\u5FD8\u8BB0\u8FD9\u591C\u7684\u6240\u89C1\u3002\u4E0D\u53EF\u4EE5\u518D\u63D0\u3002\u300D</p><p>\u300C\u2026\u2026\u300D</p><p>\u90A3\u4E4B\u540E\u662F\u79CB\uFF0C\u518D\u65E0\u4EBA\u89C1\u8FC7\u59EC\u5A1C\u3002\u8D1D\u73B2\u8FBE\u4EA6\u4F4E\u8C03\u6DF1\u5C45\u3002</p><p>\u7687\u5BA4\u7684\u4E8B\uFF0C\u4E0D\u53EF\u8FFD\u95EE\u7F62\u4E86\u3002\u53EA\u5F53\u9022\u5230\u5927\u4E3B\u6559\u6388\u8BFE\u7684\u65F6\u671F\uFF0C\u5BAB\u6BBF\u5BC2\u5BDE\u4E0B\u6765\uFF0C\u6B7B\u6C14\u6DF1\u6C89\u3002\u85CF\u4E66\u7684\u89D2\u843D\u6E10\u722C\u6EE1\u86DB\u4E1D\uFF0C\u5B58\u653E\u679C\u9171\u7684\u74F6\u5B50\u6446\u5728\u9634\u5E72\u7684\u58C1\u6A71\u3002</p><p>\u5F7C\u7AEF\u7684\u6218\u4E8B\u4EA6\u65F7\u65E5\u6301\u4E45\u3002</p><p>\u8F6C\u773C\u662F\u6DF1\u79CB\u3002\u686B\u6469\u518D\u6B21\u8BF7\u7F28\uFF0C\u5965\u6258\u9A73\u56DE\u3002</p><p>\u5C61\u6B21\u524D\u7EBF\u4F20\u6765\u6377\u62A5\uFF0C\u7F8E\u59BB\u65E5\u6E10\u9686\u8D77\u7684\u8179\uFF0C\u4EE4\u686B\u6469\u51E0\u5206\u5B89\u5FC3\u3002</p><p>\u8FE6\u697C\u82CD\u5170\u82F1\u6B66\u5584\u6218\uFF0C\u673A\u654F\u7280\u5229\u3002\u5728\u897F\u7EBF\u7684\u6218\u573A\uFF0C\u95FB\u98CE\u4E27\u80C6\u7684\u5996\u9B54\u79F0\u5979\u4E3A\u5B81\u9759\u6B7B\u795E\u3002\u66DD\u4E00\u542C\u89C1\u8FD9\u6837\u79F0\u8C13\uFF0C\u5979\u89C9\u5F97\u5B83\u5F88\u5FAE\u5999\u3002</p><p>\u6700\u540E\u7684\u6218\u5F79\u6B7B\u53BB\u592A\u591A\u4EBA\u3002\u4E00\u591C\u4E4B\u95F4\uFF0C\u904D\u91CE\u72FC\u85C9\u7684\u6218\u573A\u7ADF\u5F00\u51FA\u5996\u5F02\u7684\u5C38\u82B1\u3002</p><p>\u90A3\u4E9B\u65E0\u8BBA\u8FE6\u84DD\u65CF\u3001\u62DC\u4E9A\u65AF\u8FD8\u662F\u9B54\u65CF\u7684\u5C38\u9AB8\uFF0C\u5728\u5B83\u4EEC\u8EAB\u4E0A\u76DB\u5F00\u7684\u5996\u82B1\u7ADF\u662F\u540C\u6837\u7684\u9C9C\u8273\u3002\u82CD\u5170\u7A81\u7136\u5F00\u59CB\u660E\u767D\uFF0C\u5584\u826F\u6216\u8005\u90AA\u6076\uFF0C\u9AD8\u8D35\u6216\u8005\u5351\u5FAE\uFF0C\u5F53\u4F60\u6B7B\u53BB\uFF0C\u8EAB\u8EAF\u90FD\u662F\u4E00\u6837\u7684\u7CAA\u571F\u3002\u5373\u4FBF\u4E11\u964B\u7684\u5996\u9B54\uFF0C\u5728\u5B83\u6B7B\u53BB\uFF0C\u90A3\u8FCE\u98CE\u62DB\u5C55\u7684\u82B1\u540C\u6837\u9C9C\u5A9A\u8273\u4E3D\u3002</p><p>\u89C2\u671B\u550F\u5618\u7740\u7684\uFF0C\u8FD8\u6709\u5E74\u8FC8\u7684\u6770\u5F17\u900A\u5B50\u7235\u3002</p><p>\u4ED6\u5FF5\u52A8\u706B\u7CFB\u9B54\u6CD5\u7684\u5492\u6587\uFF0C\u4E00\u9635\u4E00\u9635\u7684\u718A\u718A\u70C8\u7130\u628A\u4E00\u5207\u90FD\u8D85\u5EA6\u6210\u7070\u3002</p><p>\u300C\u613F\u6211\u7684\u706B\u7130\uFF0C\u8D85\u5EA6\u8FE6\u84DD\u65CF\u7684\u82F1\u7075\u3002\u800C\u8FD9\u4E16\u754C\u4E0D\u518D\u6709\u6218\u4E71\u3002\u300D\u4ED6\u82CD\u8001\u7684\u58F0\u97F3\u548C\u886C\u6EE1\u76EE\u51C4\u8273\u7684\u5E03\u666F\u3002</p><p>\u5979\u8BF4\uFF1A\u300C\u6240\u4EE5\u6709\u6218\uFF0C\u662F\u5FC3\u5728\u837C\u6BD2\u3002\u300D</p><p>\u300C\u9B54\u9B3C\u837C\u4E16\uFF0C\u82F1\u96C4\u594B\u8D77\uFF0C\u6240\u4EE5\u58EE\u6B4C\u624D\u4F1A\u8C31\u5199\u3002\u300D</p><p>\u5979\u51B7\u7B11\uFF1A\u300C\u4E5F\u8BB8\u662F\u4EBA\u8981\u53BB\u706D\u9B54\uFF0C\u5996\u9B54\u6240\u4EE5\u624D\u4F1A\u4E0D\u4F24\u4EBA\u3002\u300D</p><p>\u300C\u82CD\u5170\u965B\u4E0B\uFF0C\u5728\u5927\u9646\uFF0C\u6211\u6D3B\u4E86\u4E5D\u5341\u4E5D\u5E74\uFF0C\u5927\u5C0F\u6218\u5F79\u5386\u8FC7\u65E0\u6570\uFF0C\u5374\u4ECE\u672A\u542C\u8FC7\u6709\u4EBA\u601C\u60DC\u5996\u9B54\u3002\u800C\u636E\u6211\u6240\u77E5\uFF0C\u6570\u5E74\u6765\u60A8\u7EDF\u5E05\u5929\u7A7A\u8BF8\u90E8\uFF0C\u65A9\u6740\u5996\u5B7D\u65E0\u6570\uFF0C\u4ECA\u65E5\u4ECA\u65F6\u600E\u4F1A\u4F5C\u6B64\u611F\u6168\uFF1F\u300D</p><p>\u300C\u6211\u53EA\u662F\u7A81\u7136\u89C9\u5F97\u8FD9\u4E16\u754C\u672C\u4E0D\u8BE5\u6709\u4EBA\u9B54\u4E4B\u5206\u3002\u7269\u79CD\u76F8\u5F02\uFF0C\u5F7C\u6B64\u6D6E\u751F\u3002\u4F60\u770B\u90A3\u4E48\u591A\u56FD\u5EA6\u57CE\u90A6\u4E4B\u95F4\u6DF7\u6218\u8FDE\u5E74\uFF0C\u90A3\u4E9B\u4EBA\u5171\u4EBA\uFF0C\u9B54\u5171\u9B54\uFF0C\u7A76\u7ADF\u72AF\u4E86\u4EC0\u4E48\u5929\u6761\u8981\u4E0D\u505C\u6740\u622E\uFF1F\u300D</p><p>\u300C\u8FD9\u2026\u2026\u300D</p><p>\u300C\u4EBA\u7528\u7740\u9B54\u6CD5\uFF0C\u9B54\u8BF4\u7740\u4EBA\u8A00\u3002\u7EC8\u6B64\u4E00\u751F\uFF0C\u72D7\u82DF\u8747\u8425\uFF0C\u6700\u540E\u9B42\u5F52\u6B7B\u795E\u3002\u662F\u554A\uFF0C\u6B7B\u4EA1\u662F\u6050\u6016\u7684\u9ED1\u6697\u529B\u91CF\uFF0C\u5374\u4E3A\u4EC0\u4E48\u53C8\u88AB\u79F0\u505A\u795E\uFF1F\u300D</p><p>\u300C\u82CD\u5170\u965B\u4E0B\uFF0C\u60A8\u8BF4\u7684\u8FD9\u4E9B\u5012\u4EE4\u6211\u60F3\u8D77\u4E00\u4E2A\u4F20\u8BF4\u2014\u2014\u300D</p>',63);function t(c,n){return r}var _=e(a,[["render",t]]);export{_ as default};
